INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Gumijas pakl\u0101ji gu\u013cviet\u0101m. Gumijas pakl\u0101js paredz\u0113ts liellopiem nepiesiet\u0101 tur\u0113\u0161an\u0101. Kop\u0113jais biezums ar lamel\u0113m 50mm.\r\n- Apak\u0161\u0113jais profils \u2013 zv\u012b\u0146veida lameles\r\n- \u010cetrk\u0101rt\u012bga net\u012brumu aizsargbarjera apak\u0161puses perimetr\u0101 nodro\u0161ina higi\u0113nisku st\u0101vvietu ar\u012b zem pakl\u0101ja.\r\n- \u013boti augsta nodilumiztur\u012bba\r\n- Ide\u0101ls gul\u0113\u0161anas komforts \r\n- Nodro\u0161ina pareizu govs \u0137erme\u0146a st\u0101vokli un atra\u0161anos gu\u013cviet\u0101. \r\n- Nostiprin\u0101ti ar ner\u016bs\u0113jo\u0161\u0101 t\u0113rauda betona nagl\u0101m.\r\n- izrull\u0113jams katr\u0101 gu\u013cvietu rind\u0101.\r\n- Pakl\u0101ja platums 1,83m, garumi p\u0113c projekta. \r\nCena ar pieg\u0101di un uzst\u0101d\u012b\u0161anu sagatavot\u0101 viet\u0101.", "dzivnieku_skaits_gab": 245.0, "pielietojums_govim_vecums_menesos": 12.0, "pielietojums_jaunlopiem_vecums_menesos": 0.0}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=6072&page=2', 30904.0, 'FA-13-0000054', 'Premium', 'WELALONGLINE 245', 'KRAIBURG', 'Novietnes aprīkojums', 'Fermu aprīkojums un iekārtas');
INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Re\u0123istr\u0113jam\u0101 jauda 277 Zs, maksim\u0101l\u0101 jauda 285 Zs. Dzin\u0113js: 6 cilindru 7.4 l. Transmisija: Dyna-7 28X28 p\u0101rnesumi, 50 km/h, priek\u0161\u0113j\u0101 tilta amortiz\u0101cija. Hidraulika: s\u016bk\u0146a ra\u017e\u012bgums 205 l/min, 5 hidroizvadu p\u0101ri aizmugur\u0113, 1 hidroizvadu p\u0101ris priek\u0161\u0101. Piekabju bremzes. Priek\u0161\u0113j\u0101 un aizmugur\u0113j\u0101 uzkare. Aizmugur\u0113j\u0101 j\u016bgv\u0101rpsta. Atsvari aizmugur\u0113jos rite\u0146os, priek\u0161\u0113jais atsvars. LED darba gaismas. Kab\u012bnes apr\u012bkojums: kab\u012bnes amortiz\u0101cija, Pneimatiskas amortiz\u0101cijas operatora s\u0113deklis, instruktora s\u0113deklis, Klimatkontrole, radio, autom\u0101tisk\u0101 st\u016br\u0113\u0161ana RTK ar precizit\u0101ti +/-2.5 cm, ISOBus savienojam\u012bba, 9 collu traktora vad\u012bbas monitors. No ra\u017eot\u0101ja iek\u013cauta pagarin\u0101t\u0101 garantija ar kop\u0113jo garantijas termi\u0146u 24 m\u0113ne\u0161i vai 1800 mh (bez pa\u0161riska).", "dzinejs_jauda_zs": 277.0, "dzinejs_cilindru_skaits": 6.0, "ritenu_formula": "k\u0101pur\u0137\u0113\u017eu", "transmisija_parnesumu_skaits_uz_prieksu": 28.0, "transmisija_parnesumu_skaits_atpakal": 28.0, "transmisija_bezpakapju": "N\u0113", "hidrosukna_razigums_l_min": 205.0, "uzkares_celtspeja_kg": 10000.0}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=6200&page=2', 189900.0, 'TR-01-0000637', 'Premium', '8S.265 D7 EXCLUSIVE', 'MASSEY FERGUSON', 'Lauksaimniecības traktors', 'Traktori');
