INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Bar\u012bbas bunkurs ar tilpumu 12,30m\u00b3 D2100 H5570 ar pneimatisko uzpildi. Bar\u012bbas padeves l\u012bnija ar 1,5 kW piedzi\u0146u, jauda 850 kg/h, 30mm transport\u0137\u0113de DR 850 PA66 ar ripu soli 51,0mm, 45mm cinkotas bar\u012bbas caurules, plastmasas l\u012bkumi pagriezienos, cinkoti bar\u012bbas l\u012bnijas balsti 1x1750, atzari ar \u0161\u012bberiem un virvi oran\u017ei un teleskopiskaj\u0101m caurul\u0113m 60/65x2300 BD caursp\u012bd\u012bg\u0101m, barotavu pievieno\u0161anai, vad\u012bbas bloks Dry Rapid Easy Control ar pulksteni, sensors DOL 44RG 90-265V AC, kas nodro\u0161ina autom\u0101tisku bar\u012bbas uzpildi barotav\u0101s. Iek\u0101rta nodro\u0161ina 350 nobarojamo c\u016bku autom\u0101tisku baro\u0161anu. Cen\u0101 iek\u013cauta iek\u0101rtas pieg\u0101de un uzst\u0101d\u012b\u0161ana.", "nepieciesama_maksimala_traktora_jauda_zs": 0.0, "elektromotora_jauda_kw": 1.5, "tilpums_m3": 12.3, "maisitaju_skaits": 0.0, "gabariti_m_augstums": 5.57, "gabariti_m_platums": 26.8, "gabariti_m_garums": 49.3, "tips": "pa\u0161g\u0101j\u0113js"}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=7570&page=5', 8765.0, 'FA-04-0000168', 'Bāzes', 'DR 850/350N', 'BIG DUTCHMAN', 'Dzīvnieku barošanas iekārta', 'Fermu aprīkojums un iekārtas');
INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Iegremd\u0113jams mais\u012bt\u0101js 18,5kW (25 PS), 400/690 V 50 Hz, IP 68 ar ner\u016bs\u0113jo\u0161\u0101 met\u0101la propelleri, propellera diametrs 720 mm, ar ner\u016bs\u0113jo\u0161\u0101 met\u0101la stiprin\u0101jumiem, balsta kvadr\u0101tcaurule 100mm x 100mm x 4mm x 5m, ner\u016bs\u0113jo\u0161\u0101 met\u0101la rot\u0101cijas roku un ner\u016bs\u0113jo\u0161\u0101 met\u0101la vin\u010du l\u012bdz 650kg ar 10m trosi un vad\u012bbas bloks 24h/15min mais\u012bt\u0101jam. Cen\u0101 iek\u013cauta iek\u0101rtas pieg\u0101de un uzst\u0101d\u012b\u0161ana.", "nepieciesama_piedzinas_jauda_kw": 18.5, "tips": "p\u0101rvietojams", "piedzinas_veids": "meh\u0101nisks", "jauceja_rotora_diametrs_mm": 720.0, "maksimalais_darba_dzilums_m": 6.0}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=8164&page=5', 13472.0, 'FA-18-0000023', 'Bāzes', 'PROMIX-LW 18,5KW 5M', 'DURAUMAT', 'Šķidrmēslu jaucējs', 'Fermu aprīkojums un iekārtas');
