INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "2 gab.V\u0113din\u0101ma graudu uzglab\u0101\u0161anas tvertne FRAME  FP 16/18. \r\nDiametrs 14,55 m, tilpums 2 861 m3. \r\nTvertne izgatavota no cinkota met\u0101la pl\u0101ksn\u0113m atbilsto\u0161i Eurocode standartiem.\r\nTvertnes jumta sniega slodzes notur\u012bba 250 kg/m2.\r\nKomplekt\u0101 ietilpst:\r\n2 gab. graudu uzglab\u0101\u0161anas tvertnes ar inspekcijas l\u016bk\u0101m;\r\n1 gab. sienas trepes ar aizsargre\u017e\u0123i;\r\n10 gab. v\u0113din\u0101\u0161anas izvadi jumt\u0101, katrai tvertnei 5 gab.;\r\n2 gab. aug\u0161\u0113j\u0101s servisa platformas;\r\n1 gab. inspekcijas platforma ar trep\u0113m uz servisa platformu;\r\n4 gab. s\u0101nu izvadi ar manu\u0101li vad\u0101miem aizb\u012bd\u0146iem; \r\n2 gab. apskrejo\u0161ais sav\u0101c\u0113j transportieri KTIS15/25 ar ra\u017e\u012bbu 70 t/st;\r\n2 gab. centra izvada piltuves ar elektriski vad\u0101mu aizb\u012bdni;\r\n2 gab. iek\u0161\u0113j\u0101s trepes;\r\n2 gab. Inspekcijas l\u016bkas tor\u0146a cilindr\u0101.\r\n2 gab. sniega barjeras uz jumta kores;\r\n2 gab. mastikas komplekti tvertnes hermetiz\u0101cijai ar pamatu.\r\n2 gab. v\u0113din\u0101\u0161anas kan\u0101lu gr\u012bdu komplekts, katra komplekta garums 43 m;\r\n2 gab. ventilatori FAMB 040 (22 kW);\r\n2 gab. v\u012bto gaisa vadu un savienojo\u0161o deta\u013cu komplekts, v\u0113din\u0101\u0161anas sist\u0113mai;\r\n2 gab. telaskopiskie ievadi tor\u0146os # 300mm;\r\n2 gab. telaskopiskie izvadi no tor\u0146iem # 300mm;\r\n6 gab. telaskopiskie izvadi zem tor\u0146iem FP # 300mm.\r\n2 gab. motoriz\u0113ti aizb\u012bd\u0146i zem tor\u0146iem FP;\r\n6 gab. manu\u0101lie aizb\u012bd\u0146i zem tor\u0146iem FP;\r\n2 gab. Pilna l\u012bme\u0146a sensori ar tur\u0113t\u0101jiem;\r\n1 gab.Industri\u0101lais, \u0137\u0113des tipa graudu transportieris SKANDIA ELEVATOR KTH 40/51, 200 t/st. \r\nL=34.0 m. Reduktora tipa piedzi\u0146a ar 18.5 kW elektromotoru.\r\n3 gab. elektriski vad\u0101mi izvadu aizb\u012bd\u0146i;\r\n1 gab.Industri\u0101lais \u0137\u0113des tipa graudu transportieris SKANDIA ELEVATOR KTHb 40/40, 150 t/st. \r\nL=35.0 m. \r\nDatoriz\u0113ta termokontrole. Vad\u012bbas skapja papildin\u0101\u0161ana. Elektromint\u0101\u017ea. Mont\u0101\u017ea. Pieg\u0101de.", "ietilpiba_m3": 2861.0, "izmeri_m_diametrs": 14.55, "izmeri_m_platums": 14.55, "izmeri_m_garums": 19.88, "izmeri_m_augstums": 19.88, "tips": "eksped\u012bcijas", "izkrausanas_konusa_lenkis_gradi": 0.0}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=9522&page=5', 427681.0, 'RP-02-0000108', 'Vidējais', 'FP16/18', 'TORNUM', 'Graudu glabātuve', 'Lauksaimniecības produkcijas pirmapstrādes un uzglabāšanas tehnika');
