INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Siltumizol\u0113ta caurpl\u016bdes kalts ar rekuper\u0101ciju un putek\u013cu atdal\u012b\u0161anu 25 t/h 7 gab. kalt\u0113\u0161anas/dzes\u0113\u0161anas sekcijas ar iepl\u016bdes un izpl\u016bdes kan\u0101liem 2.5 gab. bufersekcijas ar aug\u0161\u0113jo platformu - ar t\u012br\u012bt\u0101ju (putek\u013cu un pelavu) un cilkonu PPA100, 80t/h, 4kW 1 kpl. Apkalpes platforma ar k\u0101pn\u0113m 1 gab. \u0160\u012bbera tipa izbire ar elektro piedzi\u0146u 0.75 kW 1 gab. Izkrau\u0161anas transportieris K100, 80 t/h, 1.5 kW 1 gab. Izejo\u0161a gaisa kabatas - Siltin\u0101jums 100 mm, sendvi\u010dpane\u013ci mont\u0113ti ap karsto kan\u0101lu un kaltes kolonnu 3 gab. Nosl\u0113gv\u0101rsti dzes\u0113\u0161anas zonas regul\u0113\u0161anai 1 gab. Jumta servisa l\u016bka 4 gab. Av\u0101rijas izkrau\u0161anas l\u016bkas 4 gab. Apkalpes l\u016bkas izejo\u0161aj\u0101 un ieejo\u0161aj\u0101 karst\u0101 gaisa kabat\u0101 2 gab. Ventilatori \u201cCentriFan\u201d 22 kw - Ar putek\u013cu atdal\u012b\u0161anu, gaisa pl\u016bsma 30 000 m3/h pie 1200 PA - Komplekt\u0101cij\u0101: rot\u0101cijas v\u0101rsts ar caurul\u0113m, mini-ciklonu, klusin\u0101t\u0101jiem - atbalsta konstrukiju un papildus platform\u0101m 2 gab. viltus gaisa regul\u0113\u0161anas \u017eal\u016bzijas 1 gab. Modul\u0113jo\u0161ais l\u012bnijtipa g\u0101zes deglis TECFLAM VD180 GMB - 2441 kW / 2 100 000 Kcal/h - Deg\u013ca pievads DN40/32, ventilators 1 x 2.2 kW 1 gab. Vad\u012bbas panelis ar datora vad\u012bbu 4 gab. Uzpildes l\u012bme\u0146a dev\u0113ji 4 gab. Temprat\u016bras sensori un 4 gab. p\u0101rkar\u0161anas termostati 1 kpl. Mitruma kontroles sist\u0113ma Liros - Humidity Sensor HCS-4/2 - Signal Amplifier Amplifier HCS-200 - Grain Dryer Control Unit HCS-D1 for dryers with volumetric extraction 1 gab Kaltes iekrau\u0161anas elevators E80, 80 t/h, 24m, 11 kW - Komplekt\u0101cij\u0101 ar iebir\u0113m, izbir\u0113m un el. 3 pl\u016bsmu dal\u012bt\u0101ju (2x0.18kW) 1 gab Kaltes izkrau\u0161anas elevators E80, 80 t/h, 24m, 11 kW - Komplekt\u0101cij\u0101 ar iebir\u0113m, izbir\u0113m un el. 3 pl\u016bsmu dal\u012bt\u0101ju (2x0.18kW) Ra\u017e\u012bbas raksturlielumi: * Tilpums 50.9 m3, darba tilpums 36.7 m3 Ra\u017e\u012bba 25 t/h, kvie\u0161i, mitrums 19%->15%, kalt\u0113\u0161anas temp. 95C\u00b0 Ra\u017e\u012bba 12 t/h, rapsis, mitrums 13%->7%, kalt\u0113\u0161anas temp. 80C\u00b0 Ra\u017e\u012bba 15 t/h, pupas, mitrums 20%->14%, kalt\u0113\u0161anas temp. 80C\u00b0 *\u0100r\u0113j\u0101 gaisa temp. 15 C\u00b0, relat\u012bvais gaisa mitrums 70%", "darbibas_princips": "porciju", "darba_razigums_t_h": 25.0, "ietilpiba_t": 39.0, "kurinamais": ["g\u0101ze"], "kurinamais_ja_atzimets_cits": 0, "tips": "mobila"}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=10114&page=5', 217090.0, 'RP-01-0000102', 'Premium', 'GL7R 25TH', 'PRECO', 'Graudu kalte', 'Lauksaimniecības produkcijas pirmapstrādes un uzglabāšanas tehnika');
