INSERT INTO uzc_gazes.technical_equipment_lad(metadata, source, price, eds_number, equipment_level, model, mark, technical_unit, category) VALUES ('{"aprikojuma_apraksts": "Uzkarin\u0101ma kombin\u0113t\u0101 graudu s\u0113jma\u0161\u012bna, apr\u012bkota ar dubultajiem izs\u0113jas diskiem. S\u0113jma\u0161\u012bna ir kombin\u0113ta ar iesp\u0113ju iestr\u0101d\u0101t augsn\u0113 kop\u0101 ar s\u0113klu ar\u012b miner\u0101lmeslu. S\u0113jma\u0161\u012bna apr\u012bkota ar dal\u012bto bunkuru, ar diviem izsejas mehanismiem (s\u0113kla/miner\u0101lm\u0113sli). Standarta apr\u012bkojums: s\u0101nu hidrauliskie mar\u0137ieri, aizraus\u0113ja zari, traktora slie\u017eu irdin\u0101t\u0101ji, hidrauliski darbin\u0101ma tehnolo\u0123isk\u0101 sliede,  dal\u012btais bunkurs (400l sekla/370l miner\u0101lm\u0113sli), rindu skaits 23 gab, att\u0101lums strap rind\u0101m 130 mm, s\u0113jma\u0161\u012bnas mas 1334 kg, darba \u0101trums 8-12 km/h, izsejas norma s\u0101kot no 1 kg. s\u0113klas trubas teleskopiski izb\u012bd\u0101mas, pastiprin\u0101tas, iztur\u012bgas pret berzi.", "darba_platums_m": 3.0, "nepieciesama_maksimala_traktora_jauda_zs": 85.0, "tvertnes_tilpums_l_seklas": 400.0, "tvertnes_tilpums_l_mineralmeslu": 370.0, "darbibas_princips": "meh\u0101nisk\u0101", "sesanas_iespejas": ["s\u0113kla", "min. m\u0113sli"], "pievienosanas_veids_traktoram": "piekabin\u0101ma"}', 'https://eps.lad.gov.lv/show_etk_public?action=index&controller=catalog_entries_public&id=7034&page=14', 13500.0, 'ST-01-0000619', 'Vidējais', 'K300F', 'KURT', 'Sējmašīna', 'Sējas un stādāmā tehnika');
